import React, { useState,useEffect } from 'react';
import './App.css';

function App() {
    let[names,setNames] = useState({});
    useEffect(() => {
      async function FetchURL(){
        try{
          const resource = await fetch('http://127.0.0.1:8000/api/customers');
          const json = await resource.json();
          setNames(json);
        }
        catch(e){
          console.log("Error : "+e);
        }
      }
      FetchURL();
    }
    ,[]);
    console.log("names is : "+names);
    console.log("names type : "+typeof names);
    console.log(Object.keys(names).length);
    console.log(typeof names[0]);
    if(Object.keys(names).length>0){
      console.log(names[0].name);
      console.log(Object.keys(names));
    }
    return (
    <div>
      <h3>Hii happy hacking</h3>
      {
        Object.keys(names).length > 0 
        ? names.map(item => (<p>numbers</p>))
        : <p>Loading</p>
      }
    </div>
  );
}

export default App;
